  //                 <h1 style={{ color: '#3366CC' }}>Previous Orders Content</h1>
  //             </div>
  //         );
  //     }
  // };

  return (
    <div >
      <NavbarComponent func={searchBooks} />
      {/* {process()} */}
      <Row style={{ padding: 20 }}>
        <div className="col-md-4">
          <Card
            style={{
              width: "27rem"
            }}
          >
            <CardHeader>Categories</CardHeader>
            <ListGroup>
              {categories.map((c, index) => (
                <div key={index}>
                  <ListGroupItem>

                    <Nav.Link onClick={() => { getbookcategory(c.id); }}>{c.name}</Nav.Link>
                  </ListGroupItem>
                </div>
              ))}
            </ListGroup>
          </Card>
        </div>
        {/* <div className="col-md-7">{book.map((b, index) => (
          <div key={index} className="col-md-4 mb-4">
            <p>{b.bookTitle}</p>
          </div>))}

        </div> */}
        {book.map((b, index) => (
  <div key={index} className="col-md-4 mb-4">
    <Card style={{ width: '250px' }}>
     <center><Image width={200}  src={eternity} /></center> 
      <Card.Body>
        <Card.Title>{b.bookTitle}</Card.Title>
      </Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroup.Item>Author: <h6>{b.author}</h6></ListGroup.Item>
        <ListGroup.Item>category:<h6>{b.category.name}</h6></ListGroup.Item>
        <ListGroup.Item>price: <h6>{b.bookPrice}</h6></ListGroup.Item>
      </ListGroup>
      <Button variant="outline-primary">Primary</Button>
    </Card>
  </div>
))}

        
        </Row>
    </div>
  );
}

export default CustomerDashboard;
